import './App.css';
import { Book } from "./components/Book";
import { Order } from './components/Order';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Routes>
     <Route path='/book' element={<Book />}></Route>
     <Route path='order' element={<Order />}></Route>
     </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
